    true,nt"url": null,nt"notes": "<p>MedPACs Data Book is the result of discussions
    with congressional staff members regarding ways that MedPAC can better support them.
    Some of the information it contains is derived from MedPACs March and June reports
    to the Congress - other information presented is unique to the Data Book. The format
    is condensed into tables and figures with brief discussions. Website links to MedPAC
    publications and other websites are included on a Web links page at the end of each
